import React from 'react';
//import logo from './logo.svg';
import './App.css';
import Header from './components/Header/Header';
import Navbar from './components/Navbar/Navbar';
import Periods from './components/Periods/Periods'
import {Routes} from './routes';


const SECTIONS = [
    { title: 'Список лиг', href: '/leagues'},
    { title: 'Расписание лиги' ,  href: '/leagueSchedule'  },
    { title: 'Команды',  href: '/teams' },
    { title: 'Расписание команды',  href: '/teamSchedule' },
  ];

const App = (props) => { 


//console.log("LEAGUES");
//console.log("props.state.period="+props.state.period);
    return(   
        <div className="app-wrapper">
          <Header/> 
          <Periods period={props.state.period} dispatch={props.dispatch}/>
          <Navbar  period={props.state.period} sections={SECTIONS}/> 
          <div className="app-wrapper-content">
            <Routes period={props.state.period } search={props.state.search } dispatch={props.dispatch} leagues={props.state.leagues } />
          </div>    
        </div>
    );//return  
}//class

export default App;
